var tipuesearch = {"pages": [{'title': 'About', 'text': '40923236 \n 個人倉儲： https://github.com/40923236/cd2022 \n 個人網頁： https://40923236.github.io/cd2022/content/index.html \n 小組倉儲： https://github.com/40923236/cd2022bg6 \n 小組網頁： https://40723217.github.io/cd2022bg6/content/index.html', 'tags': '', 'url': 'About.html'}, {'title': 'W6', 'text': '利用 Leo Editor 編輯 網誌檔案 \n 1.輸入leo 可啟動Leo Editor \n \n 2.啟動後即可開啟編輯網頁 \n \n \n 3.編輯完成後儲存，右鍵local-blog後點選"Goto Script"後再左鍵點選 local-blog即可轉檔 \n \n 4.轉檔完成後即可acp推上遠端 \n', 'tags': '', 'url': 'W6.html'}, {'title': 'w7', 'text': '利用 scarysim開啟MTB Robot \n 1.git clone \xa0 https://github.com/mdecourse/scarysim.git \n 2.修改 scarysim.pro, 蓋掉第 11 行, 成為 # LIBS\xa0\xa0\xa0\xa0 += -lglut -lGLU \n \n 3.cd scarysim \n 4.qmake -o Makefile scarysim.pro \n 5.mingw32-make -f Makefile.Release 可以在 release 目錄取得 scarysim.exe \n 6.因為 scarysim.exe 執行需要 base.obj, arm1.obj, arm2.obj, arm3.obj 等零件外型檔案, 以及對應 的 .mtl 材質檔案, 因此可將 scarysim.exe 移至倉儲根目錄, 並且需要 msys64_20210419\\mingw64\\bin 路徑中的 dll 動態連結程式庫配合執行 \n \n \n \n', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': '', 'tags': '', 'url': 'w8.html'}, {'title': 'w15', 'text': '個人uArm零件繪製 \n 按鍵帽（短） \n \n 2.减速箱上殼（兩側） \n \n 3.减速箱下殼（兩側電機） \n \n 4.軸承支撐軸 \n \n 5.軸承支撐圈 \n \n 6.塑料蓋板 \n \n 7.鉸鏈 \n \n 8.輸出軸（兩側電機)\xa0 \n \n 9.底座中間部分 \n \n 10.前端通用件 \n \n 11.底座蓋 \n \n 12.前端關節 \n \n 13.按鈕 \n', 'tags': '', 'url': 'w15.html'}, {'title': 'w16', 'text': '已知左側綠色底座的 uArm 機械手臂, 其基座座標原點位於絕對座標 (1.0, 0.25, 0), 啟動模擬後 green_suctionpad_frame 座標原點則位於 (0.22859, 0.26047, 0.36576), 請列出運算式說明, 啟動模擬後 joint1, joint2 與 joint3 分 別以逆時針旋轉 5 度後, 求 green_suctionpad_frame 的絕對座標值 \n \n 解決方法：利用滑條程式控制三個旋轉軸旋轉，啟動模擬後控制個軸角度即可獲得三軸旋轉 5 度 之座標軸。 \n \n \n 調整後即可查看吸盤座標位置 \n \n', 'tags': '', 'url': 'w16.html'}, {'title': 'online', 'text': '40923236 \n', 'tags': '', 'url': 'online.html'}]};